    public class TestFixtureBase
    {
        public void AssertThrows<T>(Action action)
        {
            try
            {
                action();
            }
            catch (Exception ex)
            {
                Assert.That(typeof(T), Is.EqualTo(ex.GetType()));
                return;
            }

            Assert.Fail("exception not thrown");
        }
    }

    [TestFixture]
    [GeneratedCode("dummy", "dummy")]
    public class ParserTests: TestFixtureBase
    {
        JsonParser Parser;

        [SetUp]
        public void Setup()
        {
#if DEBUG
            Parser = new JsonParser { Logger = new TextWriterLogger(Console.Out), CollectLineInfo = true };
#else
            Parser = new JsonParser();
#endif
        }

        [Test]
        public void TestInvalidInput()
        {
            AssertThrows<ParserException>(() => Parser.Parse(null));
            AssertThrows<ParserException>(() => Parser.Parse(""));
            AssertThrows<ParserException>(() => Parser.Parse("  \t   \n   "));
        }

        [Test]
        public void TestBool()
        {
            Assert.That(true, Is.EqualTo(Parser.Parse("true  ")));
            Assert.That(false, Is.EqualTo(Parser.Parse("false")));
            AssertThrows<ParserException>(() => Parser.Parse("hallo"));
            AssertThrows<ParserException>(() => Parser.Parse("True"));
        }

        [Test]
        public void TestNumbers()
        {
            Assert.That(4711, Is.EqualTo(Parser.Parse("4711")));
            Assert.That(4711.0m, Is.EqualTo(Parser.Parse("4711.0")));
            Assert.That(0.1m, Is.EqualTo(Parser.Parse("0.1")));
            Assert.That(-0.1m, Is.EqualTo(Parser.Parse("-0.1")));
            Assert.That(-1, Is.EqualTo(Parser.Parse("-1")));
            Assert.That(-1.2e-3m, Is.EqualTo(Parser.Parse("-1.2e-3")));
            Assert.That(0, Is.EqualTo(Parser.Parse("0")));
            Assert.That(1000, Is.EqualTo(Parser.Parse("1e3")));
            Assert.That(Parser.Parse("1000") is int);
            Assert.That(Parser.Parse("1.2") is decimal);
            Assert.That(Parser.Parse((2L << 40).ToString()) is long);
            Assert.That(Parser.Parse("2.5e100") is double);
            AssertThrows<ParserException>(() => Parser.Parse("1e-3"));
            AssertThrows<ParserException>(() => Parser.Parse(".1"));
            AssertThrows<ParserException>(() => Parser.Parse("0."));
            AssertThrows<ParserException>(() => Parser.Parse("1.2.3"));
            AssertThrows<ParserException>(() => Parser.Parse("+1"));
            AssertThrows<ParserException>(() => Parser.Parse("0.e3"));
            AssertThrows<ParserException>(() => Parser.Parse("0.2e"));
            AssertThrows<ParserException>(() => Parser.Parse("+1"));
        }

        [Test]
        public void TestNull()
        {
            Assert.That(Parser.Parse("null") == null);
            AssertThrows<ParserException>(() => Parser.Parse("Null"));
        }

        [Test]
        public void TestString()
        {
            Assert.That("", Is.EqualTo(Parser.Parse(@"""""")));
            Assert.That("xyz", Is.EqualTo(Parser.Parse(@"""xyz""")));
            Assert.That(@"a ""b"" c", Is.EqualTo(Parser.Parse(@"""a \""b\"" c""")));
            Assert.That("\"\\/\b\f\n\r\t", Is.EqualTo(Parser.Parse(@"""\""\\\/\b\f\n\r\t""")));
            Assert.That("\u1234\u5678\uabcd", Is.EqualTo(Parser.Parse(@"""\u1234\u5678\uabcd""")));
            AssertThrows<ParserException>(() => Parser.Parse(@""""));
            AssertThrows<ParserException>(() => Parser.Parse(@"""abc"));
            AssertThrows<ParserException>(() => Parser.Parse("\"\u001f\""));
            AssertThrows<ParserException>(() => Parser.Parse(@"""\x"""));
            AssertThrows<ParserException>(() => Parser.Parse(@"""\u123"""));
            AssertThrows<ParserException>(() => Parser.Parse(@"\\\\\"));
            AssertThrows<ParserException>(() => Parser.Parse(@"""\"));
            AssertThrows<ParserException>(() => Parser.Parse(@"""\u1"));
        }

        [Test]
        public void TestList()
        {
            Assert.That(new[] { 1, 2, 3 }, Is.EquivalentTo((ICollection)Parser.Parse("[ 1, 2 , 3 ]")));
            Assert.That(new object[] { "1", 2.1m, true }, Is.EquivalentTo((ICollection)Parser.Parse(@"[""1"", 2.1, true]")));
            Assert.That((IEnumerable)Parser.Parse("[]"), Is.Empty);
            AssertThrows<ParserException>(() => Parser.Parse("["));
            AssertThrows<ParserException>(() => Parser.Parse("[1 2]"));
            AssertThrows<ParserException>(() => Parser.Parse("[1,2,]"));
            var l = (IList)Parser.Parse("[1,2,[3,4,5],6]");
            Assert.That((int)l[0] == 1);
            Assert.That((int)l[1] == 2);
            Assert.That((int)l[3] == 6);
            Assert.That(l.Count == 4);
            var l2 = (IList)l[2];
            Assert.That(l2.Count == 3);
            Assert.That((int)l2[0] == 3);
            Assert.That((int)l2[1] == 4);
            Assert.That((int)l2[2] == 5);
            var l3 = (IList)Parser.Parse("[[]]");
            Assert.That(l3.Count == 1);
            var l4 = (IList)l3[0];
            Assert.That(l4.Count == 0);
        }

        [Test]
        public void TestDictionary()
        {
            var dict = new Dictionary<string, object> { { "a", 1 },
                { "b", "b" },
                { "c", 1.2m },
                { "d", true }
            };
            Assert.That(dict, Is.EquivalentTo((ICollection)Parser.Parse(@"{""a"":1,""b"" :""b"" ,""c"": 1.2 , ""d"" : true}")));
            Assert.That((IEnumerable)Parser.Parse("{ }"), Is.Empty);
            AssertThrows<ParserException>(() => Parser.Parse("{"));
            AssertThrows<ParserException>(() => Parser.Parse(@"{""a"":1,}"));
            AssertThrows<ParserException>(() => Parser.Parse(@"{""a"":1 ""b"": 2}"));
            AssertThrows<ParserException>(() => Parser.Parse("{a:1}"));
            dict = new Dictionary<string,object> {
                { "a", 1 },
                { "b", 2 },
                { "c", new Dictionary<string, object> {
                        { "d", 3 },
                        { "e", 4 },
                        { "f", 5 },
                    }
                },
                { "g", 6 },
            };
            var d = (IDictionary<string, object>)Parser.Parse(@"{
""a"": 1,
""b"": 2,
""c"": {
    ""d"": 3,
    ""e"": 4,
    ""f"": 5
},
""g"": 6
}");
            Assert.That(dict.Keys, Is.EqualTo(d.Keys));
            Assert.That(1, Is.EqualTo(d["a"]));
            Assert.That(2, Is.EqualTo(d["b"]));
            Assert.That(6, Is.EqualTo(d["g"]));
            Assert.That(dict["c"], Is.EquivalentTo((IDictionary)d["c"]));
        }

        [Test]
        public void TestComplex()
        {
            var o = Parser.Parse(complexJsonString);
            Assert.That(o != null);
        }

        [Test]
        public void TestLogger()
        {
            var sw = new StringWriter();
            var parser = new JsonParser { Logger = new TextWriterLogger(sw), CollectLineInfo = true };
            var o = parser.Parse("4711");
            Assert.That("int: 4711\r\n", Is.EqualTo(sw.ToString()));
            AssertThrows<ParserException>(() => parser.Parse("{"));
        }

